    "2016-05-25T00:53:00.753413",nt"name": "traffic-management-advisor",nt"isopen":
    true,nt"url": null,nt"notes": "Traffic Management Advisor (TMA) computes
    flight arrival sequencing, scheduled time of arrival (STA), and estimated time of
    arrival (ETA) at various points along the aircraft flight path to an airport.  These
    points include an outer meter arc, the meter fix, the final approach fix, and runway
    threshold.  In response to changing events and controller inputs, TMA provides results
    to the en route sector team to maintain optimum flow rates to runways.  It does
    this by providing continual updates of meter fix STA and delay information at a
    speed comparable to the live radar update rates.  The team defines maneuvers and
    issues clearances so aircraft cross the meter fixes at the STA.  Since TMA calculates
    a schedule for arriving aircraft to meet Terminal Radar Approach Control (TRACON)
    facility acceptance rates set by Traffic Management Specialists (TMSs), selected
    airports must be the basis for a TMA deployment plan.",nt"license_title": "Other
